	def test_integration_vpcflow(self):

		# Set vars for CloudTrail
		self.lambda_module.SPLUNK_EVENT_DELIMITER = "space"
		self.lambda_module.SPLUNK_IGNORE_FIRST_LINE = "true"
		self.lambda_module.SPLUNK_SOURCETYPE = "aws:cloudwatchlogs:vpcflow"
		self.lambda_module.SPLUNK_TIME_DELINEATED_FIELD = "10"
		self.lambda_module.SPLUNK_TIME_FORMAT = "delineated-epoch"

		# Verify bucket is empty
		s3Client = boto3.client('s3')
		self.assertEqual(dict(s3Client.list_objects_v2(Bucket=self.bucket_name_firehose))['KeyCount'], 0)

		# Send test event to handler
		testEvent = {'Records': [{'messageId': 'messageId', 'receiptHandle': 'receipt', 'body': '{"Records":[{"eventVersion":"2.1","eventSource":"aws:s3","awsRegion":"us-west-2","eventTime":"2023-01-30T21:16:20.054Z","eventName":"ObjectCreated:Put","userIdentity":{"principalId":"AWS:redacted:prod.pdx.dbs.datafeeds.aws.internal"},"requestParameters":{"sourceIPAddress":"172.1.1.1"},"responseElements":{"x-amz-request-id":"id","x-amz-id-2":"id"},"s3":{"s3SchemaVersion":"1.0","configurationId":"configID","bucket":{"name":"' + self.bucket_name + '","ownerIdentity":{"principalId":"principalId"},"arn":"arn:aws:s3:::841154226728-ap-south-1-vpcflow"},"object":{"key":"sample-vpcflow.log.gz","size":4637,"eTag":"etag","sequencer":"sequencer"}}}]}', 'attributes': {'ApproximateReceiveCount': '1', 'SentTimestamp': '1675113380489', 'SenderId': 'SenderId', 'ApproximateFirstReceiveTimestamp': '1675113380495'}, 'messageAttributes': {}, 'md5OfBody': 'md5OfBody', 'md5OfMessageAttributes': None, 'eventSource': 'aws:sqs', 'eventSourceARN': 'arn:aws:sqs:ap-south-1:841154226728:841154226728-us-west-2-vpcflowlog-sqs-queue', 'awsRegion': 'us-west-2'}]}
		self.lambda_module.handler(testEvent, "none")

		# Verify bucket has 1 file
		self.assertEqual(dict(s3Client.list_objects_v2(Bucket=self.bucket_name_firehose))['KeyCount'], 5)

		# Download and split parse file that Firehose sent to S3 bucket
		file1 = ""
		for i in range(5):
			firehoseKey = str(dict(s3Client.list_objects_v2(Bucket=self.bucket_name_firehose))['Contents'][i]['Key'])
			s3Client.download_file(self.bucket_name_firehose, firehoseKey, "/tmp/vpcflow" + str(i) + ".log")
			with open("/tmp/vpcflow" + str(i) + ".log", 'r') as file:
				file1 += file.read()
		
		splitVPCFlowEvents = file1.split("}{")

		# Verify there are 14 events in the file sent to S3
